/*Table structure for table `transaction` */



DROP TABLE IF EXISTS `transaction`;



CREATE TABLE `transaction` (
  `from_account` varchar(50) default NULL,
  `to_account` varchar(50) default NULL,
  `amount` int(11) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



/*Data for the table `transaction` */



/*Table structure for table `transactionhistory` */



DROP TABLE IF EXISTS `transactionhistory`;



CREATE TABLE `transactionhistory` (
  `fromaccount` varchar(100) default NULL,
  `toaccount` varchar(100) default NULL,
  `thousand` int(100) default NULL,
  `fivehundred` int(100) default NULL,
  `hundred` int(100) default NULL,
  `sendername` varchar(100) default NULL,
  `receivername` varchar(100) default NULL,
  `amount` int(100) default NULL,
  `selectdate` varchar(100) default NULL,
  `selecttime` varchar(100) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



/*Data for the table `transactionhistory` */






/*Table structure for table `user` */



DROP TABLE IF EXISTS `user`;



CREATE TABLE `user` (
  `firstname` varchar(50) default NULL,
  `lastname` varchar(50) default NULL,
  `password` varchar(50) default NULL,
  `confirmpass` varchar(50) default NULL,
  `dob` date default NULL,
  `age` varchar(50) default NULL,
  `sex` varchar(50) default NULL,
  `email` varchar(50) default NULL,
  `address` varchar(50) default NULL,
  `accountno` varchar(50) NOT NULL,
  `phone` varchar(50) default NULL,
  `balance` varchar(50) default NULL,
  `bankname` varchar(50) default NULL,
  `branchname` varchar(50) default NULL,
  `image` longblob,
  PRIMARY KEY  (`accountno`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



